<h2 class="wp-block-heading" style="font-size:38px;line-height:1.4"><strong>El viaje hab√≠a comenzado, y hab√≠a comenzado felizmente con un suave cielo azul y un mar en calma.</strong></h2>



<div class="wp-block-columns is-layout-flex wp-container-core-columns-is-layout-28f84493 wp-block-columns-is-layout-flex">
<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow">
<p style="font-size:18px">La siguieron hasta la cubierta. Todo el humo y las casas hab√≠an desaparecido y el barco se encontraba en un amplio espacio de mar muy fresco y limpio, aunque p√°lido a la luz del amanecer. Hab√≠an dejado a Londres sentado sobre su barro. Una delgad√≠sima l√≠nea de sombra se estrechaba en el horizonte, apenas lo suficientemente gruesa para soportar el peso de Par√≠s que, sin embargo, descansaba sobre ella. Estaban libres de caminos, libres de la humanidad y el mismo regocijo por su libertad los recorr√≠a a todos.</p>
</div>



<div class="wp-block-column is-layout-flow wp-block-column-is-layout-flow">
<p style="font-size:18px">El barco avanzaba con paso firme a trav√©s de peque√±as olas que lo abofeteaban y, luego, se desvanec√≠an como agua efervescente, dejando un peque√±o borde de burbujas y espuma a ambos lados. El cielo incoloro de octubre estaba ligeramente nublado, como si se tratara de un rastro de humo de una hoguera, y el aire era maravillosamente salado y en√©rgico. De hecho, hac√≠a demasiado fr√≠o para quedarse quieto. La Sra. Ambrose se abraz√≥ a su marido y, mientras se alejaban, se pod√≠a ver, por la forma en que su mejilla inclinada se acercaba a la de √©l, que ten√≠a algo privado que comunicarle.</p>
</div>
</div>
